	(351,'Lady Knights Girls Basketball Program','Volumes/Uno/Bank/Schools/Senior/Katella/Programs/Girls Basketball 2010\r\nGood Morning, Daniel.\r\n \r\nI just spoke to Nadine and she requested I forward this to you as Jeff has been out for a couple of days and not known when he will be back.  Below is the original email I forwarded to Jeff with suggestions for our program.  I\'ve never done anything like this, if you need to switch pages around, please feel free to do so. \r\n \r\nIn my first attempt to send this to Jeff, it would not go through due to the size of the attachments.  I had to send several emails in order to get through, I apologize.  Hopefully it all comes through with no problems.  After you have received everything, could you please send me a quick email that you\'ve received it?  I\'d appreciate it.\r\n \r\nWe are looking for 70 copies, probably 40 pages each, in color.  The Head Basketball Coach, Jimmy Valverde, would like to pick up by latest, Tuesday, 1/12 - early afternoon if possible.  Girl\'s start their season at home Tuesday and would like to have the programs for their first home game. \r\n \r\nIf you have any questions, please do not hesitate to contact me via phone or email.  \r\n \r\nThank you so much for your help.\r\n \r\nHave a great day,\r\nTerri Sanders\r\n(714) 423-2610\r\n \r\n \r\n\r\n----- Forwarded Message ----\r\nFrom: Terri Sanders <tdsanders4t@att.net>\r\nTo: schofield_j@auhsd.us\r\nSent: Mon, January 4, 2010 3:57:53 PM\r\nSubject: KATELLA HIGH SCHOOL GIRLS BASKETBALL - PROGRAM\r\n\r\n	\r\n	\r\nHi Jeff,\r\nI hope this all comes through well!  This is my first time doing something like this, please do not hesitate to call/email if you have any questions or difficulties with the attachments.  Everything but 4 pages is in pdf.  The cover page and the 3 team photos are in jpeg.  I hope you can open/convert, whatever it takes.  For the life of me I could not convert those pictures. I do have the pictures on a disc if you are unable to open them. \r\n \r\nAs mentioned, Jimmy Valverde spoke to you, probably a month ago.  He is looking for 70 books, color pictures.  We thought we could get this done in 30 pages, but looks like we will go over as we had alot more sponsors that we had anticipated. \r\n \r\nLayout we are looking for (you may have a better idea, like I said, first time I\'ve done this)\r\n \r\nPAGE 1 - cover page\r\nPAGE 2 - inside front cover - Dedication Page\r\nPAGE 3-4 - Coaches\r\nPAGE 5 - Varsity Having Fun\r\nPAGE 6-12 - Varsity Pics and Bios\r\nPAGE 13-17 - FULL PAGE ADVERTISING (Sesma Drapery, His Nibs, Chanel, Jessie, Calfornia Coast Plumbing)\r\nPAGE 18-19 - VARSITY TEAM PIC\r\nPAGE 20-21 - JV TEAM PIC\r\nPAGE 22-23 - FROSH TEAM PIC\r\nPAGE 24-25 - JV Pics and Bios\r\nPage 26-28 - Frosh Pics and Bios\r\nSeveral pages of Ads\r\nINSIDE BACK COVER - REINBOLD GALLERIES\r\nBACK COVER - FUN SERVICES\r\n \r\nI understand the Team Pics have to be in the \"centerfold\" area as they will take up 2 pages; if you need to rearrange anything, please do as you think best.  Cover page and inside cover page, inside back cover and back cover are about the only things that Jimmy has promised these pages to the advertisers for back cover, and wants the dedication up front.\r\n \r\nPlease do not hesitate to give me a call/eamail with any questions, comments or problems. \r\n \r\nThanks for your help. \r\nTerri Sanders\r\n(714) 423-2610\r\n \r\n ',NULL,NULL,'2010-01-06','Terry Sanders','tindrum',0,41,NULL,'2010-01-06 17:17:54','2010-01-07 22:48:32','2010-01-06','',814,0,'2010-01-12 20:00:04',2,NULL),
